    false,nt"url": null,nt"notes": "We mapped vernal pool distribution within
    a 21.4 million acre area surrounding the Great Valley from 2005 National Agricultural
    Imaging Program (NAIP) county photomosaics using ESRI ArcMap 9.x in a double-blind
    protocol. Each mapped polygon was scored for classes of habitat cover, habitat density,
    habitat diversity, disturbance cover, and disturbance intensity. Ground truth sampled
    25% of the polygons we drew; the double blind protocol lowered our error rate to
    about 2 percent. We mapped 807,820 acres of vernal pool landscape in 1,909 polygons
    and present various tabular summaries of polygon number and acreage by recorded
    attribute. We overlaid our results with a map of Core Recovery Areas (CRAs), finding
    452,012 acres within the CRAs, and an additional 120,137 acres immediately contiguous
    to the CRAs.",nt"owner_org": "467d900f-8a42-452d-9906-6610dd1a767f",nt"extras":
